import { VideoList } from "./components/VideoList";

function App() {
	const arr = ['a', 'b', 'c', 'd', 'e'];
  const res = arr.map((elem, index) => {
    return <li>{elem}</li>
  })

  return (
    <ul>
      {res}
    </ul>
  )
}


export default App;

